dispatch({
    type: 'onclick'
})
    }
}

export const SearchFilter = (event, searchdata) => {
    // const searchdata = useSelector((state) => state.array2)
    return (dispatch) => {
        const ValueStore = []
        for (let i in searchdata) {
            for (let n in searchdata[i]) {
                // for (let b = 1; b >= searchdata.length; b++) {
                if (event === searchdata[i][n].name) {
                    ValueStore.push(searchdata[i][n])
                    console.log(ValueStore)
                }
            }
        }
        dispatch({
            type: 'searchfilter',
            payload: ValueStore
        })
    }
}
